import React from 'react';
import Card from './WalletCard';

const theme = {
  bg: "black"
};

const Ethereum = (props) => {
  return (

        <Card 
        bg={"black"}
        url={"./img/compound.svg"}
        networkName={"Ethereum"}
        balance={"$11,500.99"} 
        address={"0xc96265c36F6D77747f9c259946a1eF55FcE946b7"} 
        />

      );
}

export default Ethereum;
